import React from "react";
import 'bootstrap/dist/css/bootstrap.css';

const App = () => (
  <div >
    <ul className="list-inline">
    <li><a href="#">Home</a></li>
    <li><a href="#">Menu 1</a></li>
    <li><a href="#">Menu 2</a></li>
    <li><a href="#">Menu 3</a></li>
  </ul>
  </div>
);

export default App;
